import React, { useState, useEffect } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [currentUserName, setCurrentUserName] = useState("default");
  const [currentUserUID, setCurrentUserUID] = useState("default");
  const [currentUserPassword, setCurrentUserPassword] = useState("default");

  useEffect(() => {
    fetch('session/dani').then(res => res.json().then(data => {
      setCurrentUserName(data.Username);
      setCurrentUserUID(data.UID)
      setCurrentUserPassword(data.Password)
    }))
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <p>{currentUserName}</p>
        <p>{currentUserUID}</p>
        <p>{currentUserPassword}</p>
      </header>
    </div>
  );
}

export default App;
